#!/usr/bin/node

var axios = require('axios');
let data = {
  x: 1,
//y: '5000-',
  y: '50000--',
  z: { toto: true }
};

function apiCall() {
  for (let i = 0; i < 15; i++) {
    axios.post('http://localhost:8964/test', { data })
    .then(res => console.log(res.data))
    .catch(err => console.log(err));
  }
}
setInterval(apiCall, 1000);
